                Entring <input type="textarea" name="entry" />
                <br />
                Is Ship Broken?: <input type="checkbox" name="logIsBroken" />
                <br />
                <input type="submit" name="" value="Submit" />
                </form>
            </div>

        )
    }
}
module.exports = New;

